import java.util.HashMap;
import java.util.Map;

public class MinimumWindowSubstring_76 {
    public static void main(String[] args) {
//        System.out.println(minWindow("ADOBECODEBANC", "ABC"));
        //System.out.println(minWindow("a","aa"));

        String s="";
        String t="";
        //String str=sb.toString();
        System.out.println(minWindow(s,t));

    }

    public static String minWindow(String s, String t) {
        //t为目标字符串，遍历目标字符串判断该目标字符串中的数据和出现频率，
        // 以T字符串中的每个自负和出现频率在s字符串中一个个比对，
        // 当遍历到跟t中相关的字符都包含，并且出现的频率也一致时该字符串就是符合要求的子串在比较长度
        Map<Character, Integer> mapT = new HashMap<>();
        for (int i = 0; i < t.length(); i++) {
            char c = t.charAt(i);
            mapT.put(c, mapT.getOrDefault(c, 0) + 1);
        }
        //遍历字符串S
        //int start=0;
        //返回字符串
        String result = "";
        //int start = 0;
        for(int start=0;start<s.length();start++) {
        //while (start < s.length()) {
            if (mapT.containsKey(s.charAt(start))) {
                Map<Character, Integer> mapS = new HashMap<>();
                int count = 0;
                int i = start;
                //for (int i = start; i < s.length(); i++) {
                while (i < s.length()) {
                    if (mapT.containsKey(s.charAt(i))) {
                        char c1 = s.charAt(i);
                        mapS.put(c1, mapS.getOrDefault(c1, 0) + 1);
                        if (mapT.get(s.charAt(i)) >= mapS.get(s.charAt(i))) {
                            count++;
                        }
                    }
                    if (count == t.length()) {
                        if(result.equals("") || i - start + 1 < result.length()) {
                            result = s.substring(start, i + 1);
                            break;
                        } else {
                            break;
                        }
                    }
                    i++;
                }
            }
        }
        return result;
    }


}
